sys_variable_value.value:
(function execute(inputs, outputs) {
    try {
        var input = x_1143793_pd.PagerDuty_Utils.trimInputs(inputs);
        var mandatoryFields = {
            "Page Size": input.pageSize
        };
        var emptyFieldList = x_1143793_pd.PagerDuty_Utils.checkMandatoryFields(mandatoryFields);
        if (emptyFieldList.length > 0) {
            throw new Error("Mandatory Field should not be left blank - ".concat(emptyFieldList) + ".");
        }
        if (!(input.pageSize > 0 && input.pageSize <= 10000)) {
            throw Error("The value for Page Size must be between 1 and 100.")
        }
        outputs.page_size = input.pageSize;

    } catch (error) {
        throw "Error: " + e;
    }

})(inputs, outputs);

