sys_variable_value.value:
(function paginate(variables, pageResponse) {
    var totalCount = parseInt(variables.total);
    var count = parseInt(variables.limit) + parseInt(variables.offset);
    if (count < totalCount) {
        variables.page = (parseInt(variables.page) + 1).toString;
        variables.getNextPage = true;
        variables.offset = count.toString().replace(/\D/g, '');
    } else {
        variables.getNextPage = false;
    }

})(variables, pageResponse);

